import styled from "styled-components";
import { containerStyle, FONTS } from "../../assets/styles";

export default {
  Container: styled.div`
    margin: 30px 120px;
    width: 100%;
    ${containerStyle};
  `,
  Switcher: styled.div`
    padding: 25px;
    display: flex;
    flex-direction: row;
  `,
  Button: styled.div`
    padding: 19px 0px;
    width: 50%;
    text-align: center;
    font-family: ${FONTS.SEGOE_UI};
    font-style: normal;
    font-weight: 600;
    font-size: 14px;
    line-height: 19px;
    /* identical to box height */

    text-align: right;

    /* Hot Orange */

    color: #eb514e;
  `,
};
